import React,{useState} from'react';
import './SignUp.css';
const SignUp = () => {
    const [signUpClicked ,setSignUpClicked] = useState(false);
    const signInButton = (e) => {
        e.preventDefault();
    }
    const Register = (e) =>{
        e.preventDefault()
    }
    const signUpLink = (e) => {
        e.preventDefault();
        setSignUpClicked(true);
    }
    return(
        <div className='signUp'>
            <h1 className='signUp__title'>Sign {signUpClicked? 'Up' : 'In'}</h1>
            <form>
                <input type='email' placeholder='Email or phone number' />
                <input type='password' placeholder='Password' />
                <button type='submit' onClick={signInButton} style={{display:signUpClicked?'none' : 'block'}}>Sign In</button>
                <button type='submit' onClick={Register} style={{display:signUpClicked?'block' : 'none'}}>Register</button>
            </form>
            <h5><span className='signUp__new'>New to Netflix?</span> <span className='signUp__link' onClick={signUpLink}>Sign up now</span></h5>
        </div>
    )
}

export default SignUp;
